import React from 'react';


function List(props) {
  return (
  <>
  <div className="container list">
   <h1 className="text-dark text-center">Signup users</h1>
   <table class=" container table table-bordered border-primary w-50">
   <tr>
   <th class="bg-danger">Email</th>
   <th class="bg-danger">Password</th>
   </tr>
   <tr>
   <td>{props.email}</td>
   <td>{props.password}</td>
   </tr>
   </table>

 </div>

  </>
  );
}

export default List;
